import React from 'react';
import Subgenre from './Subgenre/Subgenre';
import { stringify } from 'querystring';

const SubgenreList = ({ subgenres }) => {
    console.log('subs', subgenres);
    for (sub in subgenres)
    if (typeof stringify(subgenres) != 'undefined') {
        Object.keys(subgenres).forEach(key => {
                console.log('beep', subgenres[key].name)
            })
    }
    
    return (
        <div>
            {
                /*
                Object.keys(subgenres).forEach(key => {
                    console.log('fuck', subgenres[key]);
                    
                    return <Subgenre 
                                key={subgenres[key].id}
                                id={subgenres[key].id}
                                name={subgenres[key].name}
                                 />
                })*/
            }
        </div>
    )    
}

export default SubgenreList;
